import collections

class Solution(object):
    def countCornerRectangles(self, grid):
    	count= collections.Counter()
    	rec_counter=0
    	for row in grid:
    		for c1, v1 in enumerate(row):
    			if v1:
    				for c2 in xrange(c1+1, len(row)):
    					if row[c2]:
    						#print count[c1,c2]
    						rec_counter+=count[c1,c2]
    						count[c1,c2]+=1
    	return rec_counter

